import React from 'react';

const Images = () => {

    const baseUrl = 'http://127.0.0.1:5000/analyze-mosquitoes';
    const [imageNumber, setImageNumber] = React.useState(null);

    const imageList = [1, 2, 3, 4, 5];

    const containerStyle = {
        display: 'flex',
        flexDirection: 'column',
        gap: '20px',
    };

    const buttonsContainerStyle = {
        display: 'flex',
        gap: '10px',
    };

    const buttonStyle = {
        backgroundColor: '#E1F4F3',
        padding: '10px',
        borderRadius: '5px',
        cursor: 'pointer',
    };

    const spacerStyle = {
        width: '20px', // Adjust the width as needed for the desired space
    };

    const headingStyle = {
        fontFamily: 'Arial',
        fontSize: '20px',
    };

    return (
        <div style={containerStyle}>
            <div className='dashboard'>
                {/* Your dashboard content here */}
            </div>
            <div style={buttonsContainerStyle}>
                <div style={spacerStyle}></div> {/* Empty div for space */}
                {imageList?.map((item) => (
                    <div style={buttonStyle} key={item} onClick={() => setImageNumber(item)}>
                        Sample {item}
                    </div>
                ))}
            </div>
            <div className='flex justify-center items-center'>
                {imageNumber && <img src={`${baseUrl}/${imageNumber}`} width={500} height={250} />}
            </div>
            <div style={headingStyle}>Image count detection</div>
        </div>
    );
};

export default Images;
